var nconf = require('nconf');
nconf.argv().env().file({ file: 'local.json' });

module.exports = new (require('../Engine'))({
  "id": "google.com",
  "name": "Google",
  "site": "https://www.google.com/",
  "queryUrl": "https://www.googleapis.com/customsearch/v1?key=" + nconf.get('googleAPI') + "&q={searchTerms}&cx=" + nconf.get('googleCX'),
  "suggestUrl": "https://www.google.com/complete/search?client=firefox&q={searchTerms}",
  "icon": "data:image/png;base64,"
});
